import Foundation
extension CryptoListing2 {

    func getCoin(symbol:String) -> (name:String, fullName:String, symbol:String, isTrading:Bool, imageUrl:String)? {
        return self.array.filter({ $0.symbol.lowercased() == symbol.lowercased() }).first ?? nil
    }
    //img_bg: "img_ETH_BG", logo: "img_ETH"
    func getImgBg(symbol:String) -> String {
       return "img_\(symbol)_BG"
    }
    func getLogo(symbol:String) -> String {
         return "img_\(symbol)"
    }
}
